import React from 'react';
// import { formatDate } from '../../../Tools';
import {receipts} from '../../../Utils/Dummydata';

const SingleReceipt = ( ) => {
   // date = formatDate(date, 'dd/MM/yyyy HH:mm');
   const singleReceipt = receipts.map((receipt, i) => {
      return (
         <section className="module single-transfer">
            <h1>{receipts[i].type}</h1>
            <ul>
               <li>Date: {receipts[i].date}</li>
               <li>Payee: {receipts[i].payeeName}</li>
               <li>Amount: {receipts[i].total}</li>
               <li>Type: {receipts[i].type}</li>
               <li>Status: {receipts[i].status}</li>
            </ul>
         </section>
      );
   })

   return (
      {singleReceipt}
   )
};



export default SingleReceipt;
